import React from 'react'

class Counter extends React.Component {

    constructor(props) {
        super(props)

        this.state = {
            count: 99
        }
    }

    render() {
        return (
            <div>
                Counter: {this.state.count}
            </div>
        )
    }
}

export default Counter
